Mongodb/mongoose query for completely overlapping dates (that could span multiple documents)<p>I'm having some issues designing a query that deals with overlapping dates. </p>

<p>So here's the scenario, I can't reveal too much about the actual project but here is a similar example. Lets say I have a <code>FleaMarket</code>. It has a bunch of data about itself such as <code>name</code>, <code>location</code>, etc.</p>

<p>So a <code>FleaMarket</code> would have many <code>Stalls</code>, that are available to be booked for a portion of the year (as short as 2 days, as long as all year sort of thing). So the <code>FleaMarket</code> needs to specify when in a year it will be open. Most scenarios would either be open all year, or all summer/fall, but it could possible be broken down further (because seasons determine pricing). Each <code>FleaMarket</code> would define their <code>Seasons</code> which would include a <code>startDate</code> and <code>endDate</code> (including year).</p>

<p>Here's an ERD to model this example:</p>

<p><a href="https://i.stack.imgur.com/RTcB5.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/RTcB5.png" alt="enter image description here"></a></p>

<p>When a user attempts to book a <code>Stall</code>, they have already selected a <code>FleaMarket</code> (although ideally it would be nice to search based on availability in the future). It's really easy to tell if a <code>Stall</code> is already booked for the requested dates:</p>

<pre><code>bookings = await Booking.find({
  startDate: { $lt: &lt;requested end date&gt; },
  endDate: { $gt: &lt;requested start date&gt; },
  fleaMarketId: &lt;flea market id&gt;,
}).select('stallId');
bookedIds = bookings.map(b =&gt; b.stallId);

stalls = await Stall.find({
  fleaMarketId: &lt;flea marked id&gt;,
  _id: { $nin: bookedIds }
});
</code></pre>

<p>The issue I'm having is determining if a <code>Stall</code> is available for the specified <code>Season</code>. The problem comes that 2 seasons could be sequential, so you could make a booking that spans 2 seasons.</p>

<p>I originally tried a query like so:</p>

<pre><code>seasons = await Season.find({
  fleaMarketId: &lt;flea market id&gt;,
  startDate: { $lt: &lt;requested end date&gt; },
  endDate: {$gt: &lt;requested start date&gt; }
});
</code></pre>

<p>And then programatically checked if any returned seasons were sequential, and plucked the available stalls from that that existed in all seasons. But unfortunately I just realized this won't work if the requested date only partially overlaps with a season (ex: requested <code>Jan 1 2020 - Jan 10 2020</code>, but the season is defined as <code>Jan 2 2020 - May 1 2020</code>)</p>

<p>Is there a way I can handle checking for completely overlapping dates that could possible overlap with multiple documents? I was thinking about calculating and storing the current and future available season dates (stored as total ranges) denormalized on the <code>Stall</code>.</p>

<p>At this point I'm almost thinking I need to restructure the schema quite a bit. Any recommendations? I know this seems very relational, but pretty much everywhere else in the application doesn't really do much with the relationships. It's just this search that is quite problematic.</p>

<p><strong>Update</strong>:</p>

<p>I just had the thought of maybe creating some sort of <code>Calendar</code> Document that can store a centralized list of availability for a <code>FleaMarket</code>, that would do a rolling update to only store future and present data, and slowly wiping away historical data, or maybe archiving it in a different format. Perhaps this will solve my issue, I will be discussing it with my team soon.</p>

