});
</code></pre>

<p>And then programatically checked if any returned seasons were sequential, and plucked the available stalls from that that existed in all seasons. But unfortunately I just realized this won't work if the requested date only partially overlaps with a season (ex: requested <code>Jan 1 2020 - Jan 10 2020</code>, but the season is defined as <code>Jan 2 2020 - May 1 2020</code>)</p>

<p>Is there a way I can handle checking for completely overlapping dates that could possible overlap with multiple documents? I was thinking about calculating and storing the current and future available season dates (stored as total ranges) denormalized on the <code>Stall</code>.</p>

<p>At this point I'm almost thinking I need to restructure the schema quite a bit. Any recommendations? I know this seems very relational, but pretty much everywhere else in the application doesn't really do much with the relationships. It's just this search that is quite problematic.</p>

<p><strong>Update</strong>:</p>

<p>I just had the thought of maybe creating some sort of <code>Calendar</code> Document that can store a centralized list of availability for a <code>FleaMarket</code>, that would do a rolling update to only store future and present data, and slowly wiping away historical data, or maybe archiving it in a different format. Perhaps this will solve my issue, I will be discussing it with my team soon.</p>; Answer: @vishu : check your desired ouptput

