    if(!validPass) return res.status(400).send('Email or password is wrong');

    //Create and assign a token
    const token = jwt.sign({_id: user._id}, process.env.TOKEN_SECRET, { expiresIn: 60 * 240});
    res.header('auth-token', token).send(token);
})

...

module.exports = router;
</code></pre>

<p><em>user.js (the model)</em></p>

<pre><code>const mongoose = require('mongoose');

const userSchema = new mongoose.Schema({
    name: {
        type: String,
        required: true,
        max: 255
    },
    email: {
        type: String,
        required: true,
        max: 255
    },
    password: {
        type: String,
        required: true,
        max: 1024,
        min: 6
    },
    date: {
        type: Date,
        default: Date.now
    }
});

module.exports = mongoose.model('User', userSchema);
</code></pre>

<p><strong>What I've done</strong></p>

<ul>
<li>I've checked for errors, but can't seem to find any.</li>
<li>I've checked the connection, and it is able to connect to the server.</li>
<li>I've changed the connection parameters, which did not change any behaviour. </li>
</ul>

<p><strong>My goal</strong></p>

<p>I want to be able to run the API on my Linux Ubuntu VPS so I can deploy the actual React application. Right now the login obviously doesn't work. All the other endpoints in the API (has a lot of functions / endpoints, but these not related to either the login endpoint or MongoDB) are working perfectly fine.</p>

