MongoDB aggregate queries vs. MySQL SELECT field1 FROM table<p>I am completely new to MongoDB and wanted to compare query performance of a NoSQL data model relative to its relational database counter part.  I wrote this into MongoDB shell</p>

<pre><code>// Make 10 businesses
// Each business has 10 locations
// Each location has 10 departments
// Each department has 10 teams
// Each team has 100 employees
(new Array(10)).fill(0).forEach(_=&gt;
    db.businesses.insert({
        "name":"Business Name",
        "locations":(new Array(10)).fill(0).map(_=&gt;({
            "name":"Office Location",
            "departments":(new Array(10)).fill(0).map(_=&gt;({
                "name":"Department",
                "teams":(new Array(10)).fill(0).map(_=&gt;({
                    "name":"Team Name",
                    "employees":(new Array(100)).fill(0).map(_=&gt;({
                        "age":Math.floor(Math.random()*100)
                    }))
                }))
            }))
        }))
    })
);
</code></pre>

<p>Then I attempted the equivalent of MySQL's <code>EXPLAIN SELECT age,name,(and a few other fields) FROM employees WHERE age &gt;= 50 ORDER BY age DESC</code> by writing this statement:</p>

<pre><code>db.businesses.aggregate([
    { $unwind: "$locations" },
    { $unwind: "$locations.departments" },
    { $unwind: "$locations.departments.teams" },
    { $unwind: "$locations.departments.teams.employees" },
    { $project: { _id: 0, age: "$locations.departments.teams.employees.age" } },
    { $match: { "age": { $gte: 50 }} },
    { $sort: {"age" : -1}}
]).explain("executionStats")
</code></pre>

<p>The result was: </p>

<blockquote>
  <p>"errmsg" : "Sort exceeded memory limit of 104857600 bytes, but did not
  opt in to external sorting. Aborting operation. Pass allowDiskUse:true
  to opt in.",</p>
</blockquote>

<p>So I deleted the sort clause and try to get an <code>explain</code>.  But the result was:</p>

<blockquote>
  <p>TypeError: db.businesses.aggregate(...).explain is not a function</p>
</blockquote>

<p>So my questions are:</p>

<ol>
<li><p>Primarily, I want to know the performance difference of <code>SELECT age FROM employees WHERE age &gt;= 50 ORDER BY age DESC</code> when compared with the MongoDB's aggregate query counter part.  Is it more or less the same? Will one be substantially faster or more performant than the other?</p></li>
<li><p>Alternatively, how do I fix my MongoDB query so that I can get performance details to compare against my MySQL query counter part?</p></li>
</ol>

answer:
Thanks. I ended up creating a subclass of UITableView and UICollectionView and adding this piece of code...

`- (BOOL)gestureRecognizer:(UIPanGestureRecognizer *)gestureRecognizer shouldRecognizeSimultaneouslyWithGestureRecognizer:(UISwipeGestureRecognizer *)otherGestureRecognizer {
    return YES;
}`

...as this answer recommends:
[link](http://stackoverflow.com/a/23841224/1774983)

That made the swipe of the UIPageViewController work as expected :)

